package server

import (
	"bytes"
	"context"
	"fmt"
	"google.golang.org/grpc"
	stream "grpc-image-stream-test/proto"
	"net"
)

type StreamService struct {}

const b64 = "data:image/jpg;base64,"
var data = []byte(b64)
const chunkSize = 1024

func (s StreamService) GetImageStream(_ *stream.GetImageRequest, server stream.StreamService_GetImageStreamServer) error {
	r := bytes.NewReader(data)
	buf := make([]byte, chunkSize)
	for {
		i, err := r.Read(buf)
		if err != nil {
			return err
		}
		if i < chunkSize {
			break
		}
		if err := server.Send(&stream.GetImageResponse{
			Images: buf,
		}); err != nil {
			return err
		}
	}
	return nil
}

func (s StreamService) GetImage(_ context.Context, _ *stream.GetImageRequest) (*stream.GetImageResponse, error) {
	return &stream.GetImageResponse{
		Images: data,
	}, nil
}

func Run(port int) error {
	addr := fmt.Sprintf(":%d", port)
	listener, err := net.Listen("tcp", addr)
	if err != nil {
		return err
	}

	server := grpc.NewServer()
	stream.RegisterStreamServiceServer(server, &StreamService{})
	return server.Serve(listener)
}
